window.bookSummaryJSON = "<p>Morgan is not who she thought she was. She is not a regular 16-year-old girl. She is a witch. A real, ancestral witch. Her parents are not her biological parents, and she and her sister share no blood. </p> <p>Even in the coven, she is too powerful now, too different to belong. She is alone except for Cal, who is now her boyfriend. Cal tells her he loves her, and she needs to believe him. He helps Morgan accept the truth: Wicca is in her blood. </p> <p>As Morgan learns more about Wicca, she realizes that she needs to find out more about her parentage. The answers are there, but she doesnâ€™t know how to find them.</p>"; 
